## Main Idea
First, it looks like we can convert the array `num` to integer and add it to `k`, but `num.length <= 1E+4` so this approach will cause integer overflow. So we will have to do the addition in array form.

Then the idea is to simulate the entire process, add each digit of `num` and `k` with a `carry` bit. We will terminate the loop when we run out of digits for both `num` and `k` and `carry == 0`.

## Code
```java
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        int n = num.length, carry = 0, i = n - 1;
        List<Integer> res = new ArrayList<>();

        while (i >= 0 || k > 0 || carry > 0) {
            int kDigit = k % 10;
            k /= 10;
            int sum = i >= 0 ? carry + kDigit + num[i] : carry + kDigit;
            res.add(sum % 10);
            carry = sum >= 10 ? 1 : 0;
            --i;
        }

        Collections.reverse(res);
        return res;
    }
}
```

## Complexity Analysis
Time: `O(2*max(N, log(K)))`
* Given a number `K`, its length will be `O(log_{2}(K))`, the time complexity depends on the length of `N` and `K`, whichever is longer.
* Notice we want to insert digits at the end of the array and then reverse it after we finish the addition (reverse takes `O(res.size())`). If we insert at the head of array, then it will take `O(n^2)` of time.

Space: `O(1)`, as we didn't use additional spaces except the return array.

#### Main Idea
The problem asks for the shortest distance from each character in a string s to a given character c. Since c may appear multiple times, we must compute the shortest distance to any occurrence of c for each index.

The key idea is to perform two passes over the string:

Left-to-right pass: Calculate distance from the nearest c to the left.

Right-to-left pass: Refine the distance by checking for any closer c on the right.

By using two passes, we can efficiently compute the minimal distance to the nearest c for each character.

#### Code

```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        int n = s.length();
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        for (int i = 0; i < n; ++i) {
            if (s.charAt(i) == c) {
                dist[i] = 0;
            } else if (i > 0 && dist[i - 1] < Integer.MAX_VALUE) {
                dist[i] = dist[i - 1] + 1;
            }
        }

        for (int i = n - 1; i >= 0; --i) {
            if (i < n - 1 && dist[i + 1] != Integer.MAX_VALUE) {
                dist[i] = Math.min(dist[i], dist[i + 1] + 1);
            }
        }

        return dist;
    }
}
```

#### Complexity
Time: `O(n)`
Space: `O(n)`

