## 算法思路分析
核心思想：双向遍历

这个算法使用了一种巧妙的双向遍历方法来解决问题：

1. 第一次遍历（从左到右） ：

   - 记录每个位置到其左边最近字符c的距离
   - 使用变量 prev 记录上一个字符c的位置
   - 对于每个位置i，距离为 i - prev
2. 第二次遍历（从右到左） ：

   - 计算每个位置到其右边最近字符c的距离
   - 与第一次遍历的结果取最小值，得到最终答案
   - 对于每个位置i，距离为 prev - i

## 代码
```Javascript
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function(s, c) {
    const n = s.length;
    const answer = new Array(n).fill(Infinity);

    // 第一次遍历：从左到右，记录每个位置到左边最近字符c的距离
    let prev = -Infinity;
    for (let i = 0; i < n; i++) {
        if (s[i] === c) {
            prev = i;
        }
        answer[i] = i - prev;
    }

    // 第二次遍历：从右到左，更新每个位置到右边最近字符c的距离
    prev = Infinity;
    for (let i = n - 1; i >= 0; i--) {
        if (s[i] === c) {
            prev = i;
        }
        answer[i] = Math.min(answer[i], prev - i);
    }

    return answer;
};
```

## 复杂度分析

时间复杂度：O(n)
- 需要遍历字符串两次，每次遍历都是O(n)
- 总时间复杂度为O(n) + O(n) = O(n)
- 这是最优的时间复杂度，因为至少需要访问每个字符一次

空间复杂度：O(n)
- 需要创建一个长度为n的结果数组 answer
- 除了结果数组外，只使用了常数个额外变量（ prev , i , n ）
- 如果不计算返回值所需的空间，额外空间复杂度为O(1)

