### **【Day 2】821. 字符的最短距离**

#### Main idea

1. Two linear traversals: The first one records the distance from each `s[i]` to the previous `c` from left to right; The second time, from right to left, update the minimum distance compared to the previous distance
2. ⚠️ Note: During the two initializations, the first initialization should be very small because there will be no appearance of `c` after traversing to the right for a long time. If the setting is not small enough, it will result in an insufficiently large distance value, which will affect the update of the correct value from right to left in the second traversal

```cpp
class Solution {
public:
    vector<int> shortestToChar(string s, char c) {
        int n = s.size();
        vector<int> res(n, n);
        int c_id = -n;

        for (int i = 0; i < n; i++) {

            if (s[i] == c) {
                c_id = i;
            }
            res[i] = i - c_id;
        }

        c_id = 2 * n;

        for (int j = n - 1; j >= 0; j--) {
            if (s[j] == c) {
                c_id = j;
            }

            res[j] = min(res[j], c_id - j);
        }

        return res;
    }
};
```

#### Complexity

Loop twice: $O(2*s.szie())$
